import React, { useState } from 'react';
import {
  Container,
  Box,
  Typography,
  Button,
  CircularProgress,
  Paper,
  Grid,
  AppBar,
  Toolbar,
  TextField,
  Card,
  CardContent,
  CardMedia,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import SpeedIcon from '@mui/icons-material/Speed';
import StorageIcon from '@mui/icons-material/Storage';
import AnalyticsIcon from '@mui/icons-material/Analytics';
import axios from 'axios';

const VisuallyHiddenInput = styled('input')`
  clip: rect(0 0 0 0);
  clip-path: inset(50%);
  height: 1px;
  overflow: hidden;
  position: absolute;
  bottom: 0;
  left: 0;
  white-space: nowrap;
  width: 1px;
`;

const VideoContainer = styled(Paper)(({ theme }) => ({
  width: '100%',
  height: '400px',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  marginTop: theme.spacing(3),
  marginBottom: theme.spacing(3),
  backgroundColor: '#f5f5f5',
  border: '2px dashed #ccc',
  '& video': {
    maxWidth: '100%',
    maxHeight: '100%',
  }
}));

const StyledButton = styled(Button)(({ theme }) => ({
  borderRadius: '24px',
  padding: '10px 24px',
  textTransform: 'none',
  fontSize: '16px',
}));

function App() {
  const [selectedVideo, setSelectedVideo] = useState(null);
  const [processedVideo, setProcessedVideo] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleVideoSelect = (event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedVideo(file);
      setProcessedVideo(null);
      setError(null);
    }
  };

  const handleProcessVideo = async () => {
    if (!selectedVideo) return;

    setLoading(true);
    setError(null);

    const formData = new FormData();
    formData.append('video', selectedVideo);

    try {
      const response = await axios.post('http://localhost:8000/api/process-video', formData, {
        responseType: 'blob',
      });

      const videoUrl = URL.createObjectURL(response.data);
      setProcessedVideo(videoUrl);
    } catch (err) {
      setError('Error processing video. Please try again.');
      console.error('Error:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box>
      <AppBar position="static" color="transparent" elevation={0}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1, fontWeight: 'bold' }}>
            VideoProcessor
          </Typography>
          <StyledButton color="primary" variant="outlined" sx={{ mr: 2 }}>
            Learn More
          </StyledButton>
          <StyledButton color="primary" variant="contained">
            Get Started
          </StyledButton>
        </Toolbar>
      </AppBar>

      <Container maxWidth="lg">
        {/* Hero Section */}
        <Box sx={{ textAlign: 'center', py: 8 }}>
          <Typography variant="h2" component="h1" gutterBottom>
            <Box component="span" sx={{ color: 'primary.main' }}>Real-Time</Box> Video Processing
          </Typography>
          <Typography variant="h5" color="text.secondary" sx={{ mb: 4 }}>
            Upload your video and let our advanced algorithms process it in real-time.
            Experience powerful video processing with just a few clicks.
          </Typography>

          <Box sx={{ maxWidth: '400px', mx: 'auto', mb: 4 }}>
            <TextField
              fullWidth
              placeholder="Enter your email"
              variant="outlined"
              sx={{ 
                '& .MuiOutlinedInput-root': {
                  borderRadius: '24px',
                  backgroundColor: 'white',
                }
              }}
            />
          </Box>

          {/* Video Upload Section */}
          <Box sx={{ mt: 4 }}>
            <StyledButton
              component="label"
              variant="contained"
              startIcon={<CloudUploadIcon />}
              size="large"
            >
              Upload Video
              <VisuallyHiddenInput type="file" accept="video/*" onChange={handleVideoSelect} />
            </StyledButton>
          </Box>

          {selectedVideo && (
            <Typography variant="body1" sx={{ mt: 2 }}>
              Selected: {selectedVideo.name}
            </Typography>
          )}

          {selectedVideo && (
            <VideoContainer>
              <video controls src={URL.createObjectURL(selectedVideo)} />
            </VideoContainer>
          )}

          {selectedVideo && !loading && (
            <StyledButton
              variant="contained"
              color="primary"
              onClick={handleProcessVideo}
              size="large"
            >
              Process Video
            </StyledButton>
          )}

          {loading && (
            <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
              <CircularProgress />
            </Box>
          )}

          {error && (
            <Typography color="error" sx={{ mt: 2 }}>
              {error}
            </Typography>
          )}

          {processedVideo && (
            <Box sx={{ mt: 4 }}>
              <Typography variant="h6" sx={{ mb: 2 }}>
                Processed Video
              </Typography>
              <VideoContainer>
                <video controls src={processedVideo} />
              </VideoContainer>
            </Box>
          )}
        </Box>

        {/* Features Section */}
        <Box sx={{ py: 8 }}>
          <Typography variant="h3" component="h2" textAlign="center" gutterBottom>
            Key Features
          </Typography>
          <Grid container spacing={4} sx={{ mt: 4 }}>
            <Grid item xs={12} md={4}>
              <Card sx={{ height: '100%' }}>
                <CardContent>
                  <SpeedIcon color="primary" sx={{ fontSize: 48, mb: 2 }} />
                  <Typography variant="h6" gutterBottom>
                    Real-Time Processing
                  </Typography>
                  <Typography color="text.secondary">
                    Process your videos instantly with our advanced algorithms.
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
            <Grid item xs={12} md={4}>
              <Card sx={{ height: '100%' }}>
                <CardContent>
                  <StorageIcon color="primary" sx={{ fontSize: 48, mb: 2 }} />
                  <Typography variant="h6" gutterBottom>
                    Efficient Storage
                  </Typography>
                  <Typography color="text.secondary">
                    Automatically store and manage your processed videos.
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
            <Grid item xs={12} md={4}>
              <Card sx={{ height: '100%' }}>
                <CardContent>
                  <AnalyticsIcon color="primary" sx={{ fontSize: 48, mb: 2 }} />
                  <Typography variant="h6" gutterBottom>
                    Advanced Analytics
                  </Typography>
                  <Typography color="text.secondary">
                    Get detailed insights and analytics for your videos.
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </Box>
  );
}

export default App;
